import React from 'react';
import './App.css';

function App() {
    return (
        <div>
           <AppTitle/>
            <Rating/>
            <Accordion/>
            <Rating/>

        </div>
    );
}
function AppTitle(){
    return <>This is APP component</>
}
function Rating(){
    return <>
    <Star/>
    <Star/>
    <Star/>
    <Star/>
    <Star/>


    </>
}
function Accordion(){
    return <div>
        <h3>Меню</h3>
        <ul>
            <li>1</li>
            <li>2</li>
            <li>3</li>
        </ul>
    </div>
}



export default App;
